import find from 'lodash/find';

export default {
    getAllProducts() {
        return new Promise((resolve) => {
            setTimeout(() => {
                resolve(products)
            }, 0)
        });
    },
    getProduct(id = 0) {
        return new Promise((resolve) => {
            setTimeout(() => {
                const product = find(products, {id: id});
                resolve(product);
            }, 0)
        });
    }
}